const App = () => {
  return (
    <>
    <div className="App">
        <Router>
          <Routes>
            <Route exact path='/' element={<Login />} />
           <Route path="/logout" element={
           <>
           <Login/>
           </>
           }/> 
            <Route path='/home' element={
            <>
            <Navbar />
            <Home />
            </>
            }/>
            <Route path='/student' element={
            <>
            <Navbar />
            <StudentDetails />
            </>
            }/>
            <Route path='/Profile' element={
            <>
            <Navbar />
            <Profile/>
            </>
            }/>
          </Routes>
        </Router>
      </div>
    </>
  );
};

export default App;
